    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2016-07-27T23:02:48.809845",nt"name":
    "togiak-alaska-navigation-improvements-draft-fish-and-wildlife-coordination-act-report",nt"isopen":
    false,nt"url": null,nt"notes": "The following recommendations are made
    on the basis of a field investigation, existing literature, and design information
    made available to date. (1) All instream work in Nasaurluq Slough (State Anadromous
    Fish Stream No. 326-00-10375), including water withdrawal, will be subject to a
    permit from the ADF&G. (2) Excavation work in Nasaurluq Slough should be conducted
    at low tide and out of the water. (3) Any work performed within the flowing waters
    of Nasaurluq Slough should be conducted between September 30 and May 30 in order
    to avoid concentrations of anadromous fish.",nt"license_title": "License Not
